const { default: SimpleStep } = require("../SimpleSteps/SimpleStep")
const { default: WhoWeHelp } = require("../WhoWeHelp/WhoWeHelp")


let Main = () => {

    return (
        <>
            <Home />
            <SimpleStep />
            <AboutUs />
            <WhoWeHelp />
            <Contact />
        </>
    )
}

export default Main
